style.css:
@-moz-document domain("pub.dev")
  {
body {
    color: #bfe2f3;
    background-color: #18273a;
    line-height: 1.6;
    margin: 0;
    padding: 0;
    overflow-wrap: break-word;
}

.list-item>.description {
    font-size: 14px;
    line-height: 1.3;
    color: rgb(201, 223, 239);
    margin: 0;
}

.list-item>.metadata {
    font-size: 12px;
    margin: 4px 0;
    color: #8eebf5;
}

.tooltip-dotted {
    color: aliceblue;
    border-bottom: 1px dotted #ddd;
}

.detail-tabs-header>.tab-button.-active {
    color: #d6fb7b;
    border-bottom-color: #d6fb7b;
}

.package-count {
    font-size: 16px;
    color: #cbe3f3;
    margin: 24px 6px 10px;
}


/* new update*/
.markdown-body .highlight pre, .markdown-body pre {
    padding: 16px;
    overflow: auto;
    font-size: 85%;
    line-height: 1.45;
    background-color: #132030;
    border-radius: 3px;
}

.hljs-keyword, .hljs-selector-tag, .hljs-subst {
    color: #69ece6;
    font-weight: bold;
}

.markdown-body pre code, .markdown-body pre tt {
    color: aliceblue;
    display: inline;
    max-width: auto;
    padding: 0;
    margin: 0;
    overflow: visible;
    line-height: inherit;
    word-wrap: normal;
    background-color: transparent;
    border: 0;
}

.hljs-comment, .hljs-quote {
    color: #9a9a5c;
    font-style: italic;
}

.hljs-tag, .hljs-name, .hljs-attribute {
    color: #2dfd33;
    font-weight: normal;
}

.hljs-built_in, .hljs-builtin-name {
    color: #dfe22e;
}

.hljs-string, .hljs-doctag {
    color: #ff2f8f;
}
box {
    display: inline-block;
    vertical-align: top;
    margin-left: 20px;
    -webkit-box-flex: 0;
    -ms-flex: 0 0 270px;
    flex: 0 0 270px;
    width: 270px;
    padding: 10px 20px 22px 20px;
    background: #132030;
    border: 1px solid #d6fb7b;
    position: relative;
    font-size: 14px;
}

.detail-container>.detail-info-box {
    display: inline-block;
    vertical-align: top;
    margin-left: 20px;
    -webkit-box-flex: 0;
    -ms-flex: 0 0 270px;
    flex: 0 0 270px;
    width: 270px;
    padding: 10px 20px 22px 20px;
    background: #132030;
    border: 1px solid #ddd;
    position: relative;
    font-size: 14px;
}
}
